  \"2016-07-20T03:20:44.999592\",\n\t\"name\": \"esri-binary-75-m-grid-of-the-flooding-surface-in-apalachicola-bay-based-on-seismic-reflection-p\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Apalachicola Bay and St. George Sound contain
  the largest oyster fishery in Florida, and the growth and distribution of the numerous
  oyster reefs here are the combined product of modern estuarine conditions and the
  late Holocene evolution of the bay. A suite of geophysical data and cores were collected
  during a cooperative study by the U.S. Geological Survey, the National Oceanic and
  Atmospheric Administration Coastal Services Center, and the Apalachicola National
  Estuarine Research Reserve to refine the geology of the bay floor as well as the
  bay's Holocene stratigraphy. Sidescan-sonar imagery, bathymetry, high-resolution
  seismic profiles, and cores show that oyster reefs occupy the crests of sandy shoals
  that range from 1 to 7 kilometers in length, while most of the remainder of the
  bay floor is covered by mud. The sandy shoals are the surficial expression of broader
  sand deposits associated with deltas that advanced southward into the bay between
  6,400 and 4,400 years before present. The seismic and core data indicate that the
  extent of oyster reefs was greatest between 2,400 and 1,200 years before present
  and has decreased since then due to the continued input of mud to the bay by the
  Apalachicola River. The association of oyster reefs with the middle to late Holocene
  sandy delta deposits indicates that the present distribution of oyster beds is controlled
  in part by the geologic evolution of the estuary. For more information on the surveys
  involved in this project, see http://woodshole.er.usgs.gov/operations/ia/public_ds_info.php?fa=2005-001-FA
  and http://woodshole.er.usgs.gov/operations/ia/public_ds_info.php?fa=2006-001-FA.\",\n\t\"license_title\":
